mal\" style=\"margin-bottom:6.0pt;text-align:justify;line-height:\n150%\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\n <v:stroke joinstyle=\"miter\"></v:stroke>\n <v:formulas>\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"></v:f>\n  <v:f eqn=\"sum @0 1 0\"></v:f>\n  <v:f eqn=\"sum 0 0 @1\"></v:f>\n  <v:f eqn=\"prod @2 1 2\"></v:f>\n  <v:f eqn=\"prod @3 21600 pixelWidth\"></v:f>\n  <v:f eqn=\"prod @3 21600 pixelHeight\"></v:f>\n  <v:f eqn=\"sum @0 0 1\"></v:f>\n  <v:f eqn=\"prod @6 1 2\"></v:f>\n  <v:f eqn=\"prod @7 21600 pixelWidth\"></v:f>\n  <v:f eqn=\"sum @8 21600 0\"></v:f>\n  <v:f eqn=\"prod @7 21600 pixelHeight\"></v:f>\n  <v:f eqn=\"sum @10 21600 0\"></v:f>\n </v:formulas>\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"></v:path>\n <o:lock v:ext=\"edit\" aspectratio=\"t\"></o:lock>\n</v:shapetype><v:shape id=\"image3.jpg\" o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\"\n style='width:451.5pt;height:248.25pt;visibility:visible;mso-wrap-style:square'>\n <v:imagedata src=\"file:///C:/Users/Admin/AppData/Local/Temp/msohtmlclip1/01/clip_image001.jpg\"\n  o:title=\"\"></v:imagedata>\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--></span><span lang=\"vi\" style=\"font-size:12.0pt;\nline-height:150%\"><o:p></o:p></span></p>\n\n<h2 style=\"margin-top:0in;text-align:justify;line-height:150%\"><a name=\"_j4k52ggc4407\"></a><b><span lang=\"vi\" style=\"font-size:18.0pt;mso-bidi-font-size:16.0pt;line-height:150%\">Camera 64MP\nsắc nét với khả năng quay video HDR chuyên nghiệp<o:p></o:p></span></b></h2>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">TECNO CAMON 20 sở hữu camera sau ấn\ntượng với camera chính <b>64MP</b> với 64\ntriệu điểm ảnh, cho ra những bức ảnh sắc nét đến từng chi tiết. Không chỉ vậy,\nmáy cũng có chế độ quay <b>video HDR</b>\ncùng chế độ siêu đêm, giúp tạo ra những bức ảnh, video ban đêm rõ nét và ngay cả\ncác bức ảnh ngược sáng cũng vậy. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Cùng với đó, với <b>cảm biến RGBW</b> hợp tác với Samsung, máy cho khả năng chụp ảnh trong\nđiều kiện ánh sáng tối, mang lại chất lượng hình ảnh sáng hơn, sắc nét hơn với\nvùng nhạy sáng và kích thước pixel lớn hơn.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Camera trước của máy cũng được đánh\ngiá khá cao với độ phân giải <b>32MP</b>, hỗ\ntrợ tối đa việc chụp ảnh khi tích hợp công nghệ 4 trong 1, vùng nhạy cảm của một\nđiểm ảnh tăng gấp 2 lần, mang lại màu sắc hình ảnh đẹp hơn, sáng rõ như môi trường\nánh sáng tối.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Đặc biệt, máy sở hữu đèn flash kép vi\nkhe cùng ánh sáng lấp đầy màn hình làm sáng khuôn mặt một cách tự nhiên.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2023/06/01/22.png\"><br></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;line-height:150%\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%;mso-no-proof:yes\"><!--[if gte vml 1]><v:shape\n id=\"image1.png\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" style='width:451.5pt;\n height:240pt;visibility:visible;mso-wrap-style:square'>\n <v:imagedata src=\"file:///C:/Users/Admin/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\"\n  o:title=\"\"></v:imagedata>\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--></span><span lang=\"vi\" style=\"font-size:12.0pt;\nline-height:150%\"><o:p></o:p></span></p>\n\n<h2 style=\"text-align: justify; margin-top: 0in; line-height: 150%;\"><a name=\"_kp3yxu4qfgag\"></a><b><span lang=\"vi\" style=\"font-size:18.0pt;\nmso-bidi-font-size:16.0pt;line-height:150%\">Thiết kế công thái học, siêu mỏng<o:p></o:p></span></b></h2>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Với thiết kế công thái học, TECNO\nCAMON 20 cho phép người dùng có thể sử dụng điện thoại một cách thoải mái nhất khi\ncầm nắm. Phần viền siêu mỏng với 4 cạnh vuông vức, tạo nên sự cân bằng thị giác\nvà tính thẩm mỹ cho chiếc điện thoại. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;line-height:\n150%\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Ở mặt sau, điện\nthoại có thiết kế máy ảnh ma trận kép &amp; đèn flash với thiết kế độc đáo, chắc\nchắn sẽ thu hút mọi ánh nhìn. Máy có 3 tùy chọn màu sắc Đen, Xanh dương, Trắng.\n<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;line-height:\n150%\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Điện thoại cũng\nđược trang bị loa kép cùng âm thanh DTS cho dù bạn đang phát ở bên ngoài hay\nđeo tai nghe, bạn đều có thể có được trải nghiệm nghe nhìn đắm chìm nhất.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Bên cạnh đó, điện thoại được trang bị\nviên pin<b> 5000mAh</b> và sạc nhanh<b> 33W</b>, cho thời gian sử dụng lâu dài. Vi\nxử lý <b>MediaTek Helio G85</b> cũng giúp\nmang lại hiệu năng ổn định.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 6pt; line-height: 150%;\"><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2023/06/01/33.png\"><br></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;line-height:150%\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%;mso-no-proof:yes\"><!--[if gte vml 1]><v:shape\n id=\"image2.png\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" style='width:451.5pt;\n height:300.75pt;visibility:visible;mso-wrap-style:square'>\n <v:imagedata src=\"file:///C:/Users/Admin/AppData/Local/Temp/msohtmlclip1/01/clip_image005.png\"\n  o:title=\"\"></v:imagedata>\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--></span><span lang=\"vi\" style=\"font-size:12.0pt;\nline-height:150%\"><o:p></o:p></span></p>\n\n<h2 style=\"margin-top:0in;text-align:justify;line-height:150%\"><a name=\"_ypebrxlbium3\"></a><b><span lang=\"vi\" style=\"font-size:18.0pt;mso-bidi-font-size:16.0pt;line-height:150%\">Màn hình\n6.67 inch cùng khả năng kháng bụi IP53<o:p></o:p></span></b></h2>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;line-height:\n150%\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Cùng với đó, điện\nthoại cũng sở hữu màn hình <b>6.67 inch</b>\ncùng tấm nền <b>AMOLED</b>, hỗ trợ DCI-P3\nnên sẽ gần với hiệu ứng rạp chiếu phim thực tế, giúp tất cả các màu sắc được thể\nhiện trong phim một cách chân thực hơn. Ngoài ra, màn hình cũng có gam màu rộng\n100% DCI-P3 được hỗ trợ trên màn hình hiển thị với tỷ lệ tương phản 400000:1. Đặc\nbiệt, màn hình AMOLED có thể hỗ trợ gam màu rộng hơn, hình ảnh đầy đủ, có thể\nmang lại trải nghiệm xem tốt hơn cho người dùng. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;line-height:\n150%\"><span lang=\"vi\" style=\"font-size:12.0pt;line-height:150%\">Bên cạnh đó, máy\ncũng nhận được chứng nhận ánh sáng xanh thấp, giúp bảo vệ cho đôi mắt của người\ndùng. Chưa hết, điện thoại còn được trang bị khả năng chống nước và bụi <b>IP53</b> giúp bảo vệ máy tốt hơn, yên tâm\nhơn cho 